import React, { useState, useEffect } from 'react';
import '../data.css';

function Data() {

    const [isData, setData] = useState([])
    const [isConfiguredData, setConfiguredData] = useState({
        headerNBA: [],
    })

    useEffect(() => {
        fetch('/api').then(
            res => res.json()
        ).then(data => configureData(data))
    }, [])

    function configureData(data) {
        setData(data)
        // setHeader(isData.headerNBA)

    }

    function setHeader(header) {
        header = []
        let check = true
        let index = 0
        let temp = ""

        for (let x = 0; x < 10; x++) {
            while (check) {
                if (header[index] === '*' && header[index + 1] === '$' && header[index + 2] === '$' && header[index + 3] === '&' && header[index + 4] === '*') {
                    check = false
                }
                temp += header[index]
                index++
            }

            isConfiguredData.headerNBA += temp
        }
    }

    return (
        <div className="App">
            HI
            {console.log("TEST", isData.headerNBA)}
        </div>
    );
}

export default Data;
